import React from "react";
import "./nav.css";
import icon from "../resources/icon.jpeg";
import cart from "../resources/shopping-cart-solid.svg";

const Nav = () => {
  return (
    <>
      <nav className="header">
        {/* logo on the left */}
        {/* links to different pages */}
        {/* A search box */}
        {/* profile wishlist and bag on the right */}
        <div className="icon-holder">
          <img className="header__logo" src={icon} alt="Myntra_logo" />
        </div>
        <div className="links">
          <a href="#">Men</a>
          <a href="#">Women</a>
          <a href="#">Kids</a>
          <a href="#">Home & Living</a>
          <a href="#">Beauty</a>
          <a href="#">Studio</a>
        </div>

        <div className="header__searchbox">
          <input
            type="text"
            placeholder="Search for products, brands and more"
          />
        </div>

        <div className="cart-holder">
          <button className="show-modal">
            <img
              onClick={() => {
                console.log("This is cart button");
              }}
              className="header_cart"
              src={cart}
              alt=""
            />
          </button>
        </div>
        <div class="modal hidden">
          <button class="close-modal">&times;</button>
          <h1>I'm a modal window üòç</h1>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim
            ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut
            aliquip ex ea commodo consequat. Duis aute irure dolor in
            reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla
            pariatur. Excepteur sint occaecat cupidatat non proident, sunt in
            culpa qui officia deserunt mollit anim id est laborum.
          </p>
        </div>
        <div class="overlay hidden"></div>
      </nav>
    </>
  );
};

export default Nav;
